export default function getUserData(data) {
  let profileList = [];
  
  data['data'].forEach(profile => {
    profileList.push([
      {
        type: "id",
        index: "User ID",
        data: (() => {
          try {
            let destruct = profile['data']['userid'];
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "display",
        index: "Display",
        data: (() => {
          try {
            let destruct = profile['data']['displayName'];
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "primary",
        index: "Primary Line",
        data: (() => {
          try {
            let destruct = profile['data']['primaryExtension']['pattern'];
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "department",
        index: "Department",
        data: (() => {
          try {
            let destruct = profile['data']['title'];
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "device",
        index: "MAC Address",
        data: (() => {
          try {
            let destruct = profile['data']['Phone'][0]['name'];
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "location",
        index: "Location",
        data: (() => {
          try {
            let destruct = profile['meta']['hierarchy']
            destruct = destruct.split("London Drugs.")[1]
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "",
        index: "",
        data: ""
      }
    ]);
  });

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retrieve users.")
  })
};
